import React from 'react';

import './index.css';

function Auth() {
	return (
		<div className='auth'>
			<div className='auth-signin-id'></div>
			<div className='auth-pw'></div>
			<div className='auth-btn'></div>
			<p>Forgot password?</p>
			<p>Don't have an account? <span>Sign up!</span></p>
		</div>
	);
}

export default Auth;
